class Compteur
{

  private $date;
  private $nbeppresent;
  private $nbepencours;
  private $nbepadown;
  private $nbepabsent;
  private $nbepavenir;

  Public function Compteur ( $date='' , $nbeppresent=''  , $nbepencours=''  , $nbepadown='' ,  $nbepabsent='' , $nbepavenir='' )
  {
     $this->set_date($date);
     $this->set_nbeppresent($nbeppresent);
     $this->set_nbepencours($nbepencours);
     $this->set_nbepadown($nbepadown);
     $this->set_nbepabsent($nbepabsent);
     $this->set_nbepavenir($nbepavenir);
 }
  private function set_date ( $date )
  {
	$this->date = $date ;
  }
  private function set_nbeppresent ( $nbeppresent )
  {
	$this->nbeppresent = $nbeppresent ;
  }
  private function set_nbepencours ( $nbepencours )
  {
	$this->nbepencours = $nbepencours ;
  }
  private function set_nbepadown ( $nbepadown )
  {
	$this->nbepadown = $nbepadown ;
  }
  private function set_nbepabsent ( $nbepabsent )
  {
	$this->nbepabsent = $nbepabsent ;
  }
  private function set_nbepavenir ( $nbepavenir )
  {
	$this->nbepavenir = $nbepavenir ;
  }
  public function mef ( )
  {
	$dtc = preg_split("/[: -]/",$this->date);
	return "[new Date(".$dtc[0].",".($dtc[1]-1).",".$dtc[2].",".$dtc[3].",".$dtc[4].",".$dtc[5]."),$this->nbeppresent,$this->nbepencours,$this->nbepadown,$this->nbepabsent,$this->nbepavenir]";
  }
}

Class Statistiques
{
	private $nom = "Statistique";
	private $pathtoxml;
	private $filename ;
	private $compteur = array();

	public function Statistiques ( $tabpathtoxml = array() , $method =0)
	{

		echo "-----".__FUNCTION__."-----".$tabpathtoxml[0]."</br>\n"; 
		$this->filename = $tabpathtoxml[0].$this->nom.".xml";
		//echo $this->filename."</br>\n"; 
		
		if ($tabpathtoxml[0] !=""){
			if ( $method==1){
				unlink ($this->filename);
				$ov = new OldValue();
				$rawdata=$ov->rawdata1.",".$ov->rawdata2;
				$this->LoadData($rawdata);
			} else {
				$fh = fopen($this->filename, 'r');
				while(!feof($fh)) {
					$this->LoadData(fgets($fh));
				}
				fclose($fh);
				
			}
			$this->pathtoxml=$tabpathtoxml[0];
		}
			

	}
	
  public function addcompteur ( $date='' , $nbeppresent=''  , $nbepencours=''  , $nbepadown='' ,  $nbepabsent='' , $nbepavenir='' )
  {
	$this->compteur[$date] = new Compteur( $date , $nbeppresent , $nbepencours , $nbepadown ,  $nbepabsent , $nbepavenir );
	$fh = fopen($this->filename, 'a');
	fwrite($fh, $this->compteur[$date]->mef()."\n");
	fclose($fh);
  }
	
  public function Output ( )
  {
  	echo "-----".__FUNCTION__."-----".$this->nom."</br>\n";
	$ov = new OldValue();
	$content = $ov->entete;
	$plus="";
	foreach ($this->compteur as  $compteurele){	
		$content .=	$plus . $compteurele->mef();
		$plus =",";
	}
	$content .=	$ov->pied;
	return $content;

  }
  
/*import old version*/
  Private function LoadData ( $rawdata )
  {
		$rawdata=str_replace(' ','',$rawdata );
		$rawdata=str_replace('],','',$rawdata );
		$rawdata=str_replace(']','',$rawdata );
		$rawdata=str_replace('newDate(','',$rawdata );
		$rawdata=str_replace(')','',$rawdata );
		$rawdata=str_replace('[','#',$rawdata );
		$tabdata = preg_split("/[#]/",$rawdata);
		//echo count($tabdata). "</br>\n"; 
		foreach ($tabdata as  $data){	
			$tabd = preg_split("/[,]/",$data);
			//echo count($tabd). "</br>\n"; 
			if (count($tabd)>9){
				$dt = $this->reformatdate($tabd[0],$tabd[1],$tabd[2],$tabd[3],$tabd[4],$tabd[5]);
				$this->compteur[$dt] = new Compteur($dt,$tabd[6],$tabd[7],$tabd[8],$tabd[9],$tabd[10]);
			}
		}
  }
  public function reformatdate ( $d0 , $d1 ,$d2 ,$d3 ,$d4 ,$d5 )
  {
	return "".$d0."-".($d1+1)."-".$d2." ".$d3.":".$d4.":".$d5."";
  }
}


